import "../../index.css";

const ComingSoon = () => {
  return (
		<div class="bgcomingsoon text-center">
		   <h1 class="text mb-3">COMING SOON</h1>
		   <a class="btn btn-warning putih text-reset text-decoration-none" href="/Register">Daftar</a>
		</div>
    );
  };

export default ComingSoon;
